          ? {11'h0,
             io_instruction[31],
             io_instruction[19:12],
             io_instruction[20],
             io_instruction[30:21],
             1'h0}
          : io_instruction[6:0] == 7'h13 | io_instruction[6:0] == 7'h3
            | io_instruction[6:0] == 7'h67
              ? {20'h0, io_instruction[31:20]}
